import React from "react";

export default function Navbar({ title, icon }) {
  return (
    <div className="navbar bg-info">
      <h1>
        <div>
          <i className={icon} style={{ fontSize: "42px" }}></i>
          {title}
        </div>
      </h1>
    </div>
  );
}

Navbar.defaultProps = {
  title: "Contact Keeper",
  icon: "far fa-address-card mr-3",
};
